By Council Members Salamanca and Moya

      WHEREAS, 8850 Management, LLC, filed an application pursuant to Sections 197-c and 201 of the New York City Charter for an amendment of the Zoning Map, Section No. 7d, to establish a C1-2 commercial overlay within an existing R3A zoning district on a portion of Block 4646, Borough of Queens, Community District 7 (ULURP No. C 190029 ZMQ) (the "Application");

      WHEREAS, the City Planning Commission filed with the Council on January 10, 2020 its decision dated January 8, 2020 (the "Decision") on the Application;

      WHEREAS, the Decision is subject to review and action by the Council pursuant to Section 197-d of the City Charter;

      WHEREAS, upon due notice, the Council held a public hearing on the Decision and Application on January 14, 2020;

      WHEREAS, the Council has considered the land use and other policy issues relating to the Decision and Application; and

	WHEREAS, the Council has considered the relevant environmental issues, including the negative declaration issued August 26, 2019 (CEQR No. 19DCP141Q) which include an (E) designation to avoid the potential for significant adverse impacts related to hazardous materials and  air quality (the "E" Designation (E-546));

RESOLVED:

      The Council finds that the action described herein will have no significant impact on the environment as set forth in the (E) Designation (E-546) and Negative Declaration.

      Pursuant to Sections 197-d and 200 of the City Charter and on the basis of the Decision and Application, and based on the environmental determination and consideration described in the report, C 190029 ZMQ, incorporated by reference herein, and the record before the Council, the Council approves the Decision of the City Planning Commission.

The Zoning Resolution of the City of New York, effective as of December 15, 1961, and as subsequently amended, is further amended by changing the Zoning Map, Section No. 7d, by establishing within an existing R3A district a C1-2 District bounded by 15th Avenue, 149th Street, 15th Road, a line 100 feet westerly of 149th Street, a line 75 feet northerly of 15th Road, and a line 150 feet westerly of 149th Street, Borough of Queens, Community District 7, as shown on a diagram (for illustrative purposes only) dated August 26, 2019, and subject to the conditions of CEQR Declaration E-546.

Adopted.

